import React, { Component } from 'react';
import './search_result.css';
import './box.css';
import './style.css';


class Detail extends Component {

    manage_data(){
        //var battle_id = this.props.id;

    }
    render() {
        return(
        <div class="detail">
        <table>
            <thead>
              <tr>
                <th class="winning_group">GOSTOP</th>
                <th class="losing_group">[Alliance]</th>
              </tr>
            </thead>
            <tbody>
            <td class="winners">            
                      <table class="groups">
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>K/D</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Plargo</td>
                                <td>7/3</td>
                            </tr>

                        </tbody>
                    </table>
                </td>
                <td class="winners">            
                      <table class="groups">
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>K/D</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Plargo</td>
                                <td>{this.props.d}</td>
                            </tr>

                        </tbody>
                    </table>
                </td>
            </tbody>
            </table>
            </div>
        );
    }
}

class Box extends Component {

    constructor(props) {
        super(props)
        this.state = {
            toggle: false
        }
        this.setToggle = this.setToggle.bind(this);
      }

      setToggle(){
        this.setState({
            toggle: !this.state.toggle
        })
      }

    render() {
    //    var board = [];
        return (
            <React.Fragment>
                <div class="list_box">
                <div class="content">
                    <div class="battle_info">
                        01-04-2020
                        <br />
                        {this.props.battle_id}
                        <hr />
                        win
                    </div>
                <div class="divider"></div>
                <div class="winner_info">
                    <b>[Alliance]</b>
                    <br />
                    <span class="icon-running-solid"></span> : 100
                    <br />
                    <span class="icon-skull"></span> : 50
                    <br />
                    <span class="icon-fight"></span> : 130

                </div>
                <div class="vs">
                    vs
                </div>
                <div class="loser_info">
                    <span>
                        <div class="group_name"><b>GOSTOP</b></div>
                        <span class="icon-running-solid"></span> : 150
                        <br />
                        <span class="icon-skull"></span> : 130
                        <br />
                        <span class="icon-fight"></span> : 50
                    </span>
                </div>
            </div>
            {this.state.toggle ? <Detail id={this.props.battle_id}/> : ''}

            <a class="expand" href="#" onClick={this.setToggle}>EXPAND</a>
        </div>
            </React.Fragment>
        );
    }
}

export default Box;
